import React from 'react'

export default function NavLogo() {
    return (
        <div className='absolute max-w-screen-xl'>
            <a class="inline-flex text-xl font-bold text-gray-900 hover:text-blue-500" href="#">
                <img src="/images/logo.png" alt="Logo" className="w-auto" />
                <p className='font-bold hover:text'><span>O</span>.Consoltution</p>
            </a>
        </div>
    )
}
